import React from 'react'

class DashboardPage extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      taskList : []
    };
  }

  fetchTaskList(){
    return ['hello', 'hello2'];
  }

  componentDidMount(){
    console.log(taskList)
    this.setState({taskList : this.fetchTaskList()})
    console.log(taskList)
  }

  render(){
    return (
      <>
        <h1 id="titreApp">TodoApp</h1>
        <div id="list">
          {this.state.taskList.map((item, i) => {
            return <p id={i}>{item}</p>
          })}
        </div>
      </>
    )
  }
}

export default DashboardPage;

